using PowerArgs;
using System.Text;

namespace klooie;

public class BigASCIIViewer : ProtectedConsolePanel
{
    public string Value { get => Get<string>(); set => Set(value); }

    private int lastWidth;
    private bool itsMeChangingWidth = false;

    public BigASCIIViewer(string initialValue)
    {
        this.Value = initialValue ?? string.Empty;
        lastWidth = Width;
        this.Subscribe(nameof(Value), Update, this);
        this.Subscribe(nameof(Bounds), Update, this);
        this.Subscribe(nameof(Foreground), Update, this);
        this.Subscribe(nameof(Background), Update, this);
        Update();
    }

    private void ChangeWidthInternal(int w)
    {
        itsMeChangingWidth = true;
        Width = w;
        lastWidth = w;
        itsMeChangingWidth = false;
    }

    private void Update()
    {
        if (itsMeChangingWidth) return;
        if (Width != lastWidth) throw new NotSupportedException("Can't manually set width of BigString");

        ProtectedPanel.Controls.Clear();
        var stack = ProtectedPanel.Add(new StackPanel() { AutoSize = StackPanel.AutoSizeMode.Both, Orientation = Orientation.Horizontal, Margin = 0 }).FillVertically().CenterHorizontally();
        foreach (var c in Value.ToString())
        {
            var img = BigASCII.Convert(c, Height, Foreground, Background);
            stack.Add(new BitmapControl() { Width = img.Width, Height = img.Height, Bitmap = img }).CenterVertically();
        }
        ChangeWidthInternal(stack.Width);
        Application?.RequestPaint();
    }

    public static async Task ShowDialog(string message, int height = 30, RGB? fg = null, RGB? bg = null, DialogOptions options = null)
    {
        fg = fg.HasValue ? fg.Value : RGB.Black;
        bg = bg.HasValue ? bg.Value : RGB.White;
        options = options ?? new DialogOptions()
        {
            AllowEnterToClose = true,
            AllowEscapeToClose = true,
            SpeedPercentage = .75f,
        };

        await Dialog.Show(()=>
        {
            var panel = new ConsolePanel() { Background = bg.Value, Height = height + 8 };
            var viewer = new BigASCIIViewer(message) { Foreground = fg.Value, Background = bg.Value, Height = height };
            panel.Add(viewer).CenterBoth();
            panel.Width = viewer.Width + 16;
            return panel;
        }, options);
    }
}

/// <summary>
/// A utility for creating rasterized versions of characters that can be rendered in a ConsoleApp at various sizes without the
/// user having to mess with the Console font.
/// </summary>
public class BigASCII
{
    /// <summary>
    /// Converts the given character into its ConsoleBitmap representation. You can specify the height,
    /// but the width of the bitmap will be automatically determined.
    /// </summary>
    /// <param name="c">The character to draw</param>
    /// <param name="height">the height of the bitmap to return</param>
    /// <param name="fg">The text color</param>
    /// <param name="bg">The background color</param>
    /// <returns>a ConsoleBitmap representation of a character</returns>
    public static ConsoleBitmap Convert(char c, int height, RGB? fg = null, RGB? bg = null) => _lazy.Value.ConvertInternal(c, height, fg, bg);

    private static Lazy<BigASCII> _lazy = new Lazy<BigASCII>(() => new BigASCII());

    private Dictionary<char, ConsoleBitmap> bitmaps = new Dictionary<char, ConsoleBitmap>();

    private BigASCII()
    {
        foreach (var line in ImageData.Split('\n', StringSplitOptions.RemoveEmptyEntries))
        {
            var c = line[0];
            var b64 = line.Substring(2);
            var bytes = System.Convert.FromBase64String(b64);
            var serialized = Encoding.UTF8.GetString(bytes);
            var cstr = ConsoleString.Parse(serialized);
            var bmp = cstr.ToConsoleBitmap();
            bitmaps.Add(c, bmp);
        }

        if (bitmaps.ContainsKey(' ') == false)
        {
            var blank = new ConsoleBitmap(bitmaps.First().Value.Width, bitmaps.First().Value.Height);
            blank.Fill(RGB.White);
            bitmaps.Add(' ', blank);
        }
    }

    private ConsoleBitmap ConvertInternal(char c, int height, RGB? fg = null, RGB? bg = null)
    {
        fg = fg.HasValue ? fg.Value : RGB.Black;
        bg = bg.HasValue ? bg.Value : RGB.White;
        ConsoleBitmap match = null;
        var ret = (bitmaps.TryGetValue(c, out match) ? match : bitmaps['?']);
        var ratio = height / (float)ret.Height;
        ret = ratio == 1 ? ret.Clone() : Scale(ret, ratio);
        ApplyContrast(ret, fg.Value, bg.Value);
        return ret;
    }

    private ConsoleBitmap Scale(ConsoleBitmap original, float ratio)
    {
        var dest = new ConsoleBitmap(ConsoleMath.Round(ratio * original.Height), ConsoleMath.Round(ratio * original.Height));
        if (dest.Width <= 1) return dest;
        var xRatio = original.Width / (float)dest.Width;
        var yRatio = original.Height / (float)dest.Height;

        for (var x = 0; x < dest.Width; x++)
        {
            for (var y = 0; y < dest.Height; y++)
            {
                var smallerLoc = new LocF(x / (float)dest.Width, y / (float)dest.Height);
                var originalLoc = new LocF(smallerLoc.Left * original.Width, smallerLoc.Top * original.Height);
                var originalPixBounds = new RectF(originalLoc.Left, originalLoc.Top, xRatio, yRatio);
                var neighbors = new List<(int r, int g, int b, float weight)>();

                for (var x2 = originalPixBounds.Left; x2 < originalPixBounds.Right; x2++)
                {
                    for (var y2 = originalPixBounds.Top; y2 < originalPixBounds.Bottom; y2++)
                    {
                        var origPixBounds = new RectF((int)x2, (int)y2, 1, 1);
                        var weight = originalPixBounds.OverlapPercentage(origPixBounds);
                        var origPix = original.GetPixel((int)x2, (int)y2);
                        neighbors.Add(new(origPix.BackgroundColor.R, origPix.BackgroundColor.G, origPix.BackgroundColor.B, weight));
                    }
                }

                var w = neighbors.Select(v => v.weight).Sum();
                var r = (byte)ConsoleMath.Round(neighbors.Select(v => v.r * v.weight).Sum() / w);
                var g = (byte)ConsoleMath.Round(neighbors.Select(v => v.g * v.weight).Sum() / w);
                var b = (byte)ConsoleMath.Round(neighbors.Select(v => v.b * v.weight).Sum() / w);
                var rgb = new RGB(r, g, b);
                dest.SetPixel(x, y, new ConsoleCharacter(' ', RGB.Black, rgb));
            }
        }
        return dest;
    }

    private void ApplyContrast(ConsoleBitmap bmp, RGB fg, RGB bg)
    {
        for (var x = 0; x < bmp.Width; x++)
        {
            for (var y = 0; y < bmp.Height; y++)
            {
                var targetColor = bmp.GetPixel(x, y).BackgroundColor.Brightness < .6f ? fg : bg;
                bmp.SetPixel(x, y, new ConsoleCharacter(' ', RGB.Black, targetColor));
            }
        }
    }

